    public function getSourceContext()
    {
        return new Source("{% extends 'baselogin.html.twig' %}

{% block title %}Log in!{% endblock %}

{% block body %}
<form action=\"{{ path('app_login') }}\" method=\"post\">
    {% if error %}
        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}

    {% if app.user %}
        <div class=\"mb-3\">
            Usted está conectado como: {{ app.user.userIdentifier }}, <a href=\"{{ path('app_logout') }}\">Desconectar</a>
        </div>
    {% endif %}

    <img src=\"{{ asset('images/logo.png') }}\" alt=\"Reportes Undav\" /> 
    <br>
    <br>
    <hr>
    <h1 class=\"h3 mb-3 font-weight-normal\">Ingreso al sistema</h1>
    <label for=\"inputUsername\">Usuario</label>
    <input type=\"text\" value=\"{{ last_username }}\" name=\"_username\" id=\"inputUsername\" class=\"form-control\" autocomplete=\"username\" required autofocus>
    <label for=\"inputPassword\">Password</label>
    <input type=\"password\" name=\"_password\" id=\"inputPassword\" class=\"form-control\" autocomplete=\"current-password\" required>
 
    <br>
    <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">
    {#
        Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
        See https://symfony.com/doc/current/security/remember_me.html

        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
    #}

    <button class=\"btn btn-lg btn-primary\" type=\"submit\">Ingresar</button>
    <hr>
    
</form>
{% endblock %}
", "security/login.html.twig", "/home/ntbdesa/www/reportesundav/apps/templates/security/login.html.twig");
